script: |
  super -f text -I q12706.spq | sort > q12706.out

inputs:
  - name: q12706.spq
    data: |
      SELECT DISTINCT + col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT col1 + + - col2 * - - col2 + - col0 * + - col0 + + 4 < 53;
  - name: tab0

outputs:
  - name: q12706.out
    data: |
      10
